public void testComments() throws Exception {
  String s = "ONE\n  two \nthree\n#comment";
  HashSet wordSet1 = WordlistLoader.getWordSet(new StringReader(s), "#");
  checkSet(wordSet1);
  assertFalse(wordSet1.contains("#comment"));
  assertFalse(wordSet1.contains("comment"));
}

